import { Tabs } from 'flowbite-react';
import React from 'react';
import { LuEdit, LuHeart } from "react-icons/lu";
import { IoImageOutline } from "react-icons/io5";
import "./style.scss";
import { Link, Outlet } from 'react-router-dom';
import UserPosts from '../../pages/User/posts';
import UserFavourite from '../../pages/User/favorite';
import UserPhotos from '../../pages/User/photos';


const TabProfile = () => {
    return (
        <Tabs.Group style='underline'>
            <Tabs.Item
                active
                icon={LuEdit}
                title={<Link to=""> Bài viết</Link>}>
                <div>hehe</div>
                {UserPosts}
                <Outlet />
            </Tabs.Item>

            <Tabs.Item
                icon={LuHeart}
                title={<Link to="favourites">Yêu thích</Link>}>
                <div>
                    {UserFavourite}
                </div>
                <Outlet />
            </Tabs.Item>

            <Tabs.Item
                icon={IoImageOutline}
                title={<Link to="photos">Hình ảnh</Link>}>
                {UserPhotos}
                <Outlet />
            </Tabs.Item>
        </Tabs.Group >
    );
};

export default TabProfile;
